import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';  
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { RouteList } from './pages/route-management/route-list';
import { SpecRoute } from './pages/route-management/spec-route';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Router>
       <Switch>
        <Route exact path="/route-management/list" component={RouteList}/>
				<Route exact path="/route-management/spec" component={SpecRoute}/>
	    </Switch>
    </Router>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
